import React from "react";
import ReactDom from "react-dom";
import App from "./App";
import "../node_modules/popper.js/dist/popper";
import { BrowserRouter } from "react-router-dom";

ReactDom.render(
    <BrowserRouter>
        <App />
    </BrowserRouter>,
    document.getElementById("root"));


